import React from "react";
import {Container,Form, Header} from "semantic-ui-react";


function Analyze(){
    return (
        <Container>
            <Header>分析</Header>
            <Form>
                <Form.Dropdown 
                    placeholder="分析的網站"
                    options={[
                        {
                            text: 'ptt',
                            value: 'ptt',
                        },
                    ]}
                    selection 
                />
            </Form>
        </Container>
    );
}

export default Analyze;
